import React from "react";
import { Button } from "antd";

class File extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        <input
          type="text"
          id="filename"
          className="form-control"
          placeholder="Enter file name..."
        />
        <input
          type="text"
          id="url"
          className="form-control"
          placeholder="Paste file url..."
          onKeyPress={this.props.add}
        />
      </div>
    );
  }
}
export default File;
